import React, { Component } from 'react';


class Footer extends Component {
  
  render() {
    
    return (

        <nav className="navbar fixed-bottom bg-light">
        <a className="navbar-brand" href="#">Fixed bottom</a>
        </nav>
            )
        }
}

export default Footer;
